import React from "react";
import { useForm } from "react-hook-form";
import Input from "../input";

const JoinPage = (props) => {
  const { register } = useForm();
  return (
    <div className=" px-14">
      <div>
        <h1>market</h1>
        <Input
          register={
            (register("joinid"),
            {
              required: true,
            })
          }
          label="아이디"
          name="joinid"
          kind="text"
        ></Input>
        <Input
          register={
            (register("joinid"),
            {
              required: true,
            })
          }
          type="password"
          label="비밀번호"
          name="joinpassword"
          kind="text"
        ></Input>
        <Input
          register={
            (register("joinid"),
            {
              required: true,
            })
          }
          type="password"
          label="비밀번호 재확인"
          name="joinpasswordcheck"
          kind="text"
        ></Input>
      </div>
    </div>
  );
};

export default JoinPage;
